script: |
  super -f text -I q13912.spq | sort > q13912.out

inputs:
  - name: q13912.spq
    data: |
      SELECT DISTINCT + col1 FROM tab1 (FORMAT parquet) WHERE NOT + 50 NOT BETWEEN ( 96 * col1 * - col0 / - col2 * 1 * - col0 - + col2 ) AND ( ( - col2 ) * ( - col1 ) );
  - name: tab1

outputs:
  - name: q13912.out
    data: |
      14
      47
      5
